complexParameter.core:text:
// Geometrien aufteilen in einzelne Simple Feature Geometrien
def geometries = _.geom.toSimpleGeometries(geometries: _source.p.msGeometry.first(), collections: false)

// Identifier des Quell-Objekts
def sourceId = _source.p.id.value()

// Builder konfigurieren
// - Zuweisung der Geometrie auf Ebene von geometry zulassen
_b.strictValueFlags = false

// Add collector to add collect ids and geometries
def c = _.context.collector()

// Ziel Objekt je Geometrie erstellen
int num = 1
geometries.each { geom ->
	// ID bestimmen
	def _id
	if (geometries.size() > 1) {
	  _id = "INSPIRE.Hydrografie_Bekken_${sourceId}_${num}"
	}
	else {
	  _id = "INSPIRE.Hydrografie_Bekken_${sourceId}"
	}
	
	def _ns = _project.vars.INSPIRE_DATASET_NAMESPACE

	// Ziel-Objekt erstellen mit IDs und Geometrie
	_target {
		id( _id )
		inspireId {
			Identifier {
				localId( _id )
				namespace( _ns )
			}
		}
		identifier( _ns ? (_ns.endsWith('/') ? _ns : _ns + '/') + _id : _id ) {
			codeSpace( 'http://inspire.ec.europa.eu/ids' )
		}
		geometry(geom)
	}
	
	// collect ID and geometry based on zone
	c.basinParts[_source.p.rZoneId.value()] << [_id, geom]

	num++
}

// Geometrien aufteilen in einzelne Simple Feature Geometrien
def geometries = _.geom.toSimpleGeometries(geometries: _source.p.msGeometry.first(), collections: false)

// Identifier des Quell-Objekts
def sourceId = _source.p.id.value()

// Builder konfigurieren
// - Zuweisung der Geometrie auf Ebene von geometry zulassen
_b.strictValueFlags = false

// Add collector to get part ids and geometries
def c = _.context.collector()

// Ziel Objekt je Geometrie erstellen
int num = 1
geometries.each { geom ->
	// ID bestimmen
	def _id
	boolean split = geometries.size() > 1
	if (split) {
	  _id = "INSPIRE.Hydrografie_Bekken_${sourceId}_${num}"
	}
	else {
	  _id = "INSPIRE.Hydrografie_Bekken_${sourceId}"
	}
	
	def _ns = _project.vars.INSPIRE_DATASET_NAMESPACE
	
	// get list of parts based on zone
	def parts = c.basinParts[_source.p.thematicId.value()].values()

	// Ziel-Objekt erstellen mit IDs und Geometrie
	_target {
		id( _id )
		inspireId {
			Identifier {
				localId( _id )
				namespace( _ns )
			}
		}
		identifier( _ns ? (_ns.endsWith('/') ? _ns : _ns + '/') + _id : _id ) {
			codeSpace( 'http://inspire.ec.europa.eu/ids' )
		}
		geometry(geom)
		
		if (!split) {
			// every part is part of the zone
	  		parts.each { part ->
	  			containsBasin {
	  				href( '#' + part[0] )
	  			}
	  		}
		}
		else {
			// we need to determine based on the geometry, which part belongs here
			parts.findAll { part ->
				// part geometry
				def partGeom = part[1].geometry
				def zoneGeom = geom.geometry
				
				zoneGeom.covers(partGeom)
			}.each { part ->
	  			containsBasin {
	  				href( '#' + part[0] )
	  			}
	  		}
		}
	}

	num++
}

